import React from 'react';
import './styles.css';

function Sidebar() {
  return (
    <div className="sidebar sidebar-custom">
      <div className="sidebar-list">
        <div className="sidebar-item">Avaliações</div>
        <div className="sidebar-item active">Gerenciamento</div>
      </div>
    </div>
  );
}

export default Sidebar;
